    (ans, d) = ([1] * len(queries), [0] * len(queries))
    for i in range(len(queries)):
        (n, k) = queries[i]
        for j in p:
            while k % j == 0:
                k //= j
                d[i] += 1
            if j > k ** 0.5 + 1:
                break
        if prime[k]:
            d[i] += 1
        if d[i] > n - 1 or n > k:
            ans[i] = 0
        else:
            ans[i] = c[d[i] - 1][n - 1]
    return ans

